import * as URL from "../Const/URL";
import * as TYPE from "../Const/Types";
const initialState = [];

export default (state = initialState, Action) => {
    switch (Action.type) {
        case TYPE.UPDATE_LIST_USER:
            return [...Action.listUser];
        default:
            return state;
    }
};
